import 'bootstrap/dist/css/bootstrap.min.css'
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';

function App() {

  return (
    <div id = "App" style={{overflowX: 'hidden'}}>
    <NavBar/>
    <Row className="p-4">

    <Col md='12' lg='2'>
    <Search/>
    </Col>

    <Col md='12' lg='8'>
    <Search/>
    </Col>

    <Col md='12' lg='6'>
    <Search/>
    </Col>

    </Row>
    <Footer/>
    </div>
  );
}

export default App;
